import React from "react";
import { Link } from "react-router-dom";

const Header = () => {
  return (
    <div class="header">
      <div class="header_items">
        {" "}
        <Link to={"#"}> Home </Link>{" "}
        {/* <a href="#"> Home </a> <a href="#"> Products </a>{" "}
                    <a href="#"> About </a> <a href="#"> Help </a>{" "} */}{" "}
      </div>{" "}
      <div>
        <img
          src="../../images/cart.png"
          alt="This is an image"
          width="500"
          height="300"
        />
      </div>{" "}
    </div>
  );
};
export default Header;
